import React from 'react'
import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation,Autoplay } from 'swiper/modules';

const ListImgSlider = [
    {img : "https://data-service.pharmacity.io/pmc-ecm-webapp-config-api/production/banner/Slide%20banner%20desktop2%20-%20913x280px%20(1)-1706499803361.png"},
    {img : "https://data-service.pharmacity.io/pmc-ecm-webapp-config-api/production/banner/banner%20web%20(1)-1706756457149.png"},
    {img : "https://data-service.pharmacity.io/pmc-ecm-webapp-config-api/production/banner/913x280%20(x1.5)%20(5)%20(1)-1705025795286.png"},
    {img : "https://data-service.pharmacity.io/pmc-ecm-webapp-config-api/production/banner/913x280x1.5(1370x420)_VMST12-1703730026474.jpg"},
    {img : "https://data-service.pharmacity.io/pmc-ecm-webapp-config-api/production/banner/913x280%20(x1.5)%20copy%202-1703904593788.png"},
]
export default function HomePage() {
  return (
    <div style={{background:"#ccc"}}>
      <section className='pb-4 bg-white'>
        <div className="container-xxl">
            <div className="row">
                <div className="col-8">
                    <Swiper
                        slidesPerView={1}
                        spaceBetween={30}
                        loop={true}
                        pagination={{
                            clickable: true,
                        }}
                        autoplay={{
                        delay: 3000,
                        disableOnInteraction: false,
                        }}
                        navigation={true}
                        modules={[Navigation,Autoplay]}
                        className="mySwiper"
                    >
                        {
                            ListImgSlider.map((e,index)=>(
                                <SwiperSlide key={index}>
                                    <img style={{borderRadius:"20px"}} width="100%" height="258px" src={e.img} alt="sliderbar" />
                                </SwiperSlide>
                            ))
                        }
                    </Swiper>
                </div>
                <div className="col-4">
                    <div className="">
                        <div className="">
                            <img style={{borderRadius:"20px"}} width="100%" height="123px" src="https://data-service.pharmacity.io/pmc-ecm-webapp-config-api/production/banner/392x134-1703645825291.png" alt="sliderbar" />
                        </div>
                        <div className="pt-3">
                            <img style={{borderRadius:"20px"}} width="100%" height="123px" src="https://data-service.pharmacity.io/pmc-ecm-webapp-config-api/production/banner/392x134px-1691463642426.png" alt="sliderbar" />
                        </div>
                    </div>
                </div>
            </div>
        </div>
      </section>
    </div>
  )
}
